Synopsis:
     Yukino was kicked out of Sabertooth. She was allowed into Fairy Tail A's inn and she offered the other 2 keys to Lucy. Meaning, if Lucy accepted she would have all 12 Zodiac keys. Having all 12, according to the ancient legend, will open the gate which will change the world. Though Lucy declined saying that Celestial Spirit Magic is about trust and bonds. Yukino pointed out that they may be the only Celestial Spirit wizards left after the Zentopia incident. She also said that she wasn't one of the 5 strongest members. She was just a newbie. Yukino left stating that she knows when the time is right, Lucy will have all 12 Zodiac keys. Meanwhile, Erza is talking to Milliana and Milliana reveals that Jellal took everything away drom Kaguras and Kagura has vowed to only unsheathe her sword , Archenemy, against him. Her sword is intended to kill him. Milliana also hates him and Erza didn't have the heart to tell Milliana that he wasn't evil anymore. Also, Arcadios says that he will have both the Celestial Spirit Wizards that have the Zodiac Keys and the Eclipse Project will run smoothly. Then he started chanting Zeref. Natsu and Happy ran after Yukino to apolog ise and after the apology Yukino revealed all that happened. Natsu ran to Crocus Garden, and took out many members. He challenged Jiemma to a battle and if Jiemma lost he was no longer the master and kicked out of the guild. Jiemma accepted this battle.


